DROP TABLE IF EXISTS `mcat_attr_groups`;
CREATE TABLE `mcat_attr_groups` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_attrs`;
CREATE TABLE `mcat_attrs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `title` varchar(100) NOT NULL,
  `type` int(11) NOT NULL,
  `value` text NOT NULL,
  `unit` varchar(10) NOT NULL,
  `options` int(11) NOT NULL,
  `group` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_brands`;
CREATE TABLE `mcat_brands` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL,
  `url` varchar(250) NOT NULL,
  `img` varchar(10) NOT NULL,
  `descr` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_cart`;
CREATE TABLE `mcat_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) NOT NULL,
  `sid` varchar(32) NOT NULL,
  `type` int(11) NOT NULL,
  `container` text NOT NULL,
  `update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_exchanger`;
CREATE TABLE `mcat_exchanger` (
  `param` varchar(20) NOT NULL,
  `value` varchar(20) NOT NULL,
  PRIMARY KEY (`param`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_images`;
CREATE TABLE `mcat_images` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_tvr` int(11) NOT NULL,
  `index` int(11) NOT NULL,
  `name` varchar(60) NOT NULL,
  `caption` varchar(60) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1078 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_nodes`;
CREATE TABLE `mcat_nodes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `root` int(11) NOT NULL,
  `name` varchar(250) NOT NULL,
  `link` varchar(250) NOT NULL,
  `scomment` text NOT NULL,
  `fcomment` text NOT NULL,
  `img` varchar(150) NOT NULL,
  `template` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `root` (`root`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_templ_attrs`;
CREATE TABLE `mcat_templ_attrs` (
  `templ` int(11) NOT NULL,
  `attr` int(11) NOT NULL,
  `order` int(11) NOT NULL,
  KEY `templ` (`templ`,`attr`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_templs`;
CREATE TABLE `mcat_templs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_tvrs`;
CREATE TABLE `mcat_tvrs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat` int(11) NOT NULL,
  `templ` int(11) NOT NULL,
  `opts` smallint(11) NOT NULL DEFAULT '0',
  `article` varchar(30) NOT NULL,
  `brand` int(5) NOT NULL,
  `name` varchar(200) NOT NULL,
  `name_def` varchar(200) NOT NULL,
  `alias` varchar(100) NOT NULL,
  `price` int(11) NOT NULL,
  `price_d` int(11) NOT NULL,
  `count` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `cat` (`cat`,`templ`),
  KEY `cat_2` (`cat`),
  KEY `templ` (`templ`),
  KEY `templ_2` (`templ`)
) ENGINE=MyISAM AUTO_INCREMENT=3052 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mcat_values`;
CREATE TABLE `mcat_values` (
  `tvr` int(11) NOT NULL,
  `attr` int(11) NOT NULL,
  `t1` smallint(6) DEFAULT NULL,
  `t2` int(11) DEFAULT NULL,
  `t3` double DEFAULT NULL,
  `t4` date DEFAULT NULL,
  `t5` varchar(250) DEFAULT NULL,
  `t6` text,
  `t7` text,
  KEY `tvr` (`tvr`,`attr`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mgcore_plugins`;
CREATE TABLE `mgcore_plugins` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `options` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `mgcore_users`;
CREATE TABLE `mgcore_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `login` varchar(30) NOT NULL,
  `password` varchar(32) NOT NULL,
  `rights` int(11) NOT NULL,
  `name` varchar(30) NOT NULL,
  `email` varchar(40) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;


